import React from 'react'


const Button = props => {
  const { title,color,width,height } = props

  return (
    <button className={`btn_component ${color}`}>
     {title}
     <style jsx>
     {
       `
        .btn_component 
        {
          height : ${height};
          width : ${width};
        }
       `
       }
       </style>
    </button>
  )
}

export default Button
